import React from 'react';
import cn from 'classnames';
import styles from './Errors.module.scss';
export const PasswordsMismatch = ({className, text}) => {
    return (
        <div className={cn(className, styles.passwords_mismatch)}>
            {text}
        </div>
    );
};
